import React, { Component } from 'react';
import { Grid } from '@material-ui/core';
import axiosProp from "../components/axiosProp";

export default class Propiedad extends Component {
    render() {
        const { match } = this.props
        const val = match.params.id

        return (
            <>
                <Grid container spacing={3}>
                    <Grid item xs={12}>
                    </Grid>
                    <Grid item xs={6}>



                        <axiosProp value={val} />


                    </Grid>
                    <Grid item xs={6}>
                        <h3>CONTENIDO</h3>
                    </Grid>
                </Grid>
            </>
        )
    }
}
